class HTMLSidebarElement extends HTMLElement{constructor(){super();const t=this.attachShadow({mode:"open"}),e=document.createElement("style");e.textContent="\n            :host {\n                max-width: 240px;\n                background-color: white;\n                position: fixed;\n                top: 0;\n                left: 0;\n                transition: all 1s;\n                box-shadow: 0 0 10px rgba(0,0,0,0.2);\n                display: block;\n                height: 100%;\n                width: 100%;\n            }\n\n            :host[open] {\n                left: -100%;\n            }\n\n            :host[open][partial] {\n                left: -75%;\n            }\n        ",t.append(e),t.append(document.createElement("slot"))}open(){this.setAttribute("open","")}close(){this.removeAttribute("open")}toggle(){this.hasAttribute("open")?this.close():this.open()}}customElements.define("html-sidebar",HTMLSidebarElement);